  `address` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '地址',
  `linkman` varchar(55) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '联系人',
  `tel` varchar(25) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '联系电话',
  `dot` mediumint(9) NULL DEFAULT 0 COMMENT '订单所用积分',
  `dot_total` float(8, 2) NULL DEFAULT 0.00 COMMENT '积分所抵金额',
  `coupon_id` mediumint(9) NULL DEFAULT NULL COMMENT '所用优惠券',
  `coupon_total` float(8, 2) NULL DEFAULT 0.00 COMMENT '优惠券金额',
  `money` decimal(8, 2) NULL DEFAULT 0.00 COMMENT '所用余额',
  `rank_money` float(8, 2) NULL DEFAULT 0.00 COMMENT '角色折扣',
  `refund_status` tinyint(1) NULL DEFAULT 0 COMMENT '退款状态|0=未退款,1=部分退款,2-全部退款',
  `refund_total` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '退款金额',
  `pay_type` tinyint(4) NULL DEFAULT 0 COMMENT '付款方式|1=货到付款,2=在线抵消,3=支付宝,4=微信',
  `pay_status` tinyint(4) NULL DEFAULT 0 COMMENT '支付状态|0=待支付,1=已支付,2=已退款,3=拒绝退款',
  `pay_time` datetime NULL DEFAULT NULL COMMENT '支付时间',
  `trade_no` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '第三方支付交易号',
  `delivery_type` tinyint(1) NULL DEFAULT 1 COMMENT '配送方式|1=快递发货,2=上门自提,3=同城配送',
  `delivery_status` tinyint(1) UNSIGNED NULL DEFAULT 0 COMMENT '发货状态',
  `delivery_total` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '运费',
  `delivery_time` datetime NULL DEFAULT NULL COMMENT '最后新发货时间',
  `admin_remark` varchar(150) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '后台备注',
  `source` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '0' COMMENT '来源',
  `is_new` tinyint(4) NULL DEFAULT 0 COMMENT '新客户',
  `p_ordernum` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '拼团订单',
  `group_num` tinyint(4) NULL DEFAULT 0 COMMENT '拼团数量',
  `seckill_id` int(10) NULL DEFAULT NULL COMMENT '秒杀商品id',
  `group_id` int(10) NULL DEFAULT NULL COMMENT '拼团产品ID',
  `goods_num` int(11) NULL DEFAULT 0 COMMENT '商品数量',
  `status` tinyint(2) NULL DEFAULT 0 COMMENT '订单状态|0=待付款,1=待发货,2=待收货,3=已完成,4=已关闭,5=拼团中,6=拼团失败',
  `comment_status` tinyint(1) NULL DEFAULT 0 COMMENT '评论状态|0=未评论,1=已评论',
  `create_time` datetime NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime NULL DEFAULT NULL COMMENT '更新时间',
  `after_status` tinyint(4) NULL DEFAULT 0 COMMENT '售后|0=未申请退款,1=申请退款中,2=等待退款,3=退款成功',
  `master_id` int(11) NULL DEFAULT NULL,
  `p_orderid` int(11) NULL DEFAULT NULL COMMENT '上级',
  `shop_id` int(11) NULL DEFAULT NULL COMMENT '门店id',
  `pid` int(11) NULL DEFAULT NULL COMMENT '推荐人id',
  `goods_type` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '商品类型',
  PRIMARY KEY (`order_id`) USING BTREE,
  INDEX `ordernum`(`ordernum`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 433 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '商城订单' ROW_FORMAT = DYNAMIC;

