  `pid` int(11) NOT NULL DEFAULT 0 COMMENT '推荐人',
  `username` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '用户名',
  `pwd` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '密码',
  `email` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '邮箱',
  `qq` varchar(16) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT 'qq',
  `status` tinyint(4) NOT NULL DEFAULT 1 COMMENT '1=启用，0=禁用',
  `is_rand` tinyint(4) NULL DEFAULT 0 COMMENT '1=随机，0=正常',
  `rank` tinyint(4) NOT NULL DEFAULT 0 COMMENT '等级（0=粉丝,1=普通会员,2=VIP会员）',
  `create_time` datetime NULL DEFAULT NULL COMMENT '添加时间',
  `create_ip` varchar(15) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '创建IP',
  `tel` varchar(15) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '手机号码',
  `openid` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT 'openid',
  `unionid` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT 'unionid',
  `nickname` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '昵称',
  `money` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '余额',
  `dot` int(10) NOT NULL DEFAULT 0 COMMENT '积分',
  `bro` decimal(8, 2) NOT NULL DEFAULT 0.00 COMMENT '佣金',
  `headimgurl` varchar(155) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '头像',
  `sex` tinyint(4) NULL DEFAULT NULL COMMENT '性别',
  `weixin` varchar(55) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '微信号',
  `realname` varchar(55) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '真实姓名',
  `province` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '省份',
  `city` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '城市',
  `country` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '区域',
  `birthday` varchar(25) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '生日',
  `info_status` tinyint(4) NULL DEFAULT 1 COMMENT '信息状态|0=未完善,1=已完善',
  `address` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `role` tinyint(4) NULL DEFAULT 0 COMMENT '角色|1=董事,2=合伙人',
  `shop_id` int(11) NULL DEFAULT NULL COMMENT '所属店长',
  `is_main` tinyint(4) NULL DEFAULT 0 COMMENT '主号',
  `referee_path` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '推荐路径',
  `left` int(11) NULL DEFAULT 0,
  `center` int(11) NULL DEFAULT 0,
  `right` int(255) NULL DEFAULT 0,
  `ppath` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '路径',
  `is_pay` int(11) NULL DEFAULT 0,
  `is_agent` int(11) NULL DEFAULT 0,
  `consumption` decimal(10, 2) NULL DEFAULT NULL,
  `is_director` int(11) NULL DEFAULT 0 COMMENT '董事',
  `is_hehuo` int(11) NULL DEFAULT 0 COMMENT '合伙人',
  `plevel` int(11) NULL DEFAULT 1 COMMENT '层数',
  `invitation_code` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `lvse_dot` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '绿色积分',
  `daijinquan` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '代金券',
  `jinhuoquan` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '进货券',
  `gongxianzhi` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '贡献值',
  `duihuanquan` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '兑换券',
  `pwd2` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 306 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '用户' ROW_FORMAT = DYNAMIC;

