-- ----------------------------
DROP TABLE IF EXISTS `xf_user_login`;
CREATE TABLE `xf_user_login`  (
  `id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '系统编号',
  `time` datetime NULL DEFAULT NULL COMMENT '时间',
  `ip` varchar(25) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'IP',
  `user_id` int(11) NULL DEFAULT NULL COMMENT '用户编号',
  `source` varchar(55) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '来源',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '用户登录日志' ROW_FORMAT = DYNAMIC;

