-- ----------------------------
-- Table structure for xf_user_msg
-- ----------------------------
DROP TABLE IF EXISTS `xf_user_msg`;
CREATE TABLE `xf_user_msg`  (
  `id` mediumint(8) UNSIGNED NOT NULL AUTO_INCREMENT,
  `user_id` mediumint(9) NULL DEFAULT NULL COMMENT '接收信息的用户ID',
  `sender` varchar(25) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '发送者',
  `title` varchar(55) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '标题',
  `content` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '内容',
  `time` datetime NULL DEFAULT NULL COMMENT '发送时间',
  `is_read` tinyint(4) NULL DEFAULT 0 COMMENT '0=未读，1=已读',
  `is_del` tinyint(4) NULL DEFAULT 0 COMMENT '0=不删除，1=删除',
  `type` tinyint(4) NULL DEFAULT 1 COMMENT '类型',
  `link` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '链接',
  `map` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '其他参数',
  `master_id` int(11) NULL DEFAULT NULL COMMENT '师傅',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 8 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '用户消息表' ROW_FORMAT = DYNAMIC;

